import React from 'react'
import NdPage from './2ndPage.js'
import RendForm from './RendForm.js'

export default class Page1 extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          isLoggedIn: "false"
        }
      }

    onUpdate = (val) => {
        //if(val !== this.state.isLoggedIn)
          this.setState({ isLoggedIn: val })
      };
    render(){
        console.log("[page1] test with isloggedin : "+this.state.isLoggedIn)
        if(this.state.isLoggedIn === "true"){
            console.log("Affichage ndpage : "+this.state.isLoggedIn)

            return <NdPage/>;
        }
        return <RendForm onUpdate={() => this.onUpdate} handleSubmit ={this.props.handleSubmit}/>;
    }

}
